uint32_t am_widget_i2s_pin_enable(void)
{

    am_bsp_i2s_pins_enable(I2S_CHANNEL_0, false);
    am_bsp_i2s_pins_enable(I2S_CHANNEL_1, false);

    return AM_HAL_STATUS_SUCCESS;
}

uint32_t am_widget_i2s_build_configuration(uint32_t i2s_channel,
                                           i2s_loopback_test_settings_t* test_setting,
                                           am_hal_i2s_config_t* config)
{
    //
    // build i2s config according to test setting
    //
    if (test_setting->master_channel == i2s_channel)
    {
        config->eMode = AM_HAL_I2S_IO_MODE_MASTER;
        config->eXfer = test_setting->master_role;
    }
    else
    {
        config->eMode = AM_HAL_I2S_IO_MODE_SLAVE;
        //
        // set slave role corresponding to the master role
        //
        if (test_setting->master_role == AM_HAL_I2S_XFER_RXTX)
        {
            config->eXfer = AM_HAL_I2S_XFER_RXTX;
        }
        else if (test_setting->master_role == AM_HAL_I2S_XFER_RX)
        {
            config->eXfer = AM_HAL_I2S_XFER_TX;
        }
        else
        {
            config->eXfer = AM_HAL_I2S_XFER_RX;
        }
    }

    config->eClock = (am_hal_i2s_clksel_e)test_setting->clock_source;
    //
    // io configurations
    //
    config->eIO->eFyncCpol = test_setting->fsync_cpol;
    config->eIO->eRxCpol = test_setting->rx_cpol;
    config->eIO->eTxCpol = test_setting->tx_cpol;
    //
    // data configurations
    //
    config->eData->ePhase       = test_setting->phase;
    config->eData->eDataJust    = test_setting->justify;
    config->eData->eChannelLenPhase1    = test_setting->eFrameWordLenPh1;
    config->eData->eChannelLenPhase2    = test_setting->eFrameWordLenPh2;
    config->eData->ui32ChannelNumbersPhase1    = test_setting->ui32ChannelNumbersPhase1;
    config->eData->ui32ChannelNumbersPhase2    = test_setting->ui32ChannelNumbersPhase2;
    config->eData->eSampleLenPhase1    = test_setting->eSampleLenPhase1;
    config->eData->eSampleLenPhase2    = test_setting->eSampleLenPhase2;
    config->eData->eDataDelay = 1;
    config->eDiv3 = 0;
    config->eASRC = 0;

    return AM_WIDGET_I2S_SUCCESS;
}

uint32_t am_widget_i2s_build_asrc_configuration(uint32_t i2s_channel,
                                                i2s_asrc_test_settings_t* test_setting,
                                                am_hal_i2s_config_t* config)
{
    //
    // build i2s config according to test setting
    //
    if (test_setting->master_channel == i2s_channel)
    {
        config->eClock = (am_hal_i2s_clksel_e)test_setting->m_clock_source;
        config->eDiv3  = test_setting->m_div3;

        config->eMode = AM_HAL_I2S_IO_MODE_MASTER;
        config->eXfer = test_setting->master_role;
        config->eASRC = 0;
    }
    else
    {
        config->eClock = (am_hal_i2s_clksel_e)test_setting->s_clock_source;
        config->eDiv3  = test_setting->s_div3;

        config->eMode = AM_HAL_I2S_IO_MODE_SLAVE;
        //
        // set slave role corresponding to the master role
        //
        if (test_setting->master_role == AM_HAL_I2S_XFER_RXTX)
        {
            config->eXfer = AM_HAL_I2S_XFER_RXTX;
        }
        else if (test_setting->master_role == AM_HAL_I2S_XFER_RX)
        {
            config->eXfer = AM_HAL_I2S_XFER_TX;
        }
        else
        {
            config->eXfer = AM_HAL_I2S_XFER_RX;
        }

        config->eASRC = 1;
    }

    return AM_WIDGET_I2S_SUCCESS;
}

void am_widget_i2s_handler_deinitialize(void)
{
    am_hal_i2s_deinitialize(I2S0Handle);
    am_hal_i2s_deinitialize(I2S1Handle);
}

bool am_widget_i2s_check_data(uint32_t ui32BufSize, uint32_t* pui32RxBuf, uint32_t* pui32TxBuf, i2s_loopback_test_settings_t* pI2sSetting, bool bRxIsMaster)
{
    uint32_t i, ui32Mask, ui32Mask1, ui32Mask2, ui32WordBytes;

    uint32_t ui32ChNumPh1 = pI2sSetting->ui32ChannelNumbersPhase1;
    uint32_t ui32ChNumPh2 = pI2sSetting->ui32ChannelNumbersPhase2;
    uint32_t ui32SampleLenPh1 = ui32I2sWordLength[pI2sSetting->eSampleLenPhase1];
    uint32_t ui32SampleLenPh2 = ui32I2sWordLength[pI2sSetting->eSampleLenPhase2];
    uint32_t ui32FrameChNum = ui32ChNumPh1 + ui32ChNumPh2;

    bool bFIXTDM = false;
    bool bFIX8B16B = false;

    #if defined(AM_PART_APOLLO5A)
    bFIXTDM = false;
    bFIX8B16B = false;
    #elif defined(AM_PART_APOLLO5B)
    //
    // Check if CAB-668 fix and CAB-669 fix are enabled.
    // 0: not enable, 1: enable
    //
    bFIXTDM = ((I2Sn(0)->AMQCFG & I2S0_AMQCFG_FIXTDM_Msk) == 0) ? false : true;
    bFIX8B16B = ((I2Sn(0)->AMQCFG & I2S0_AMQCFG_FIX8B16B_Msk) == 0) ? false : true;
    #endif

    if (bFIX8B16B == false)
    {
        if (ui32SampleLenPh1 == 16)
        {
            ui32BufSize -= 2;
        }
        if (ui32SampleLenPh1 == 8)
        {
            ui32BufSize -= 3;
        }
    }

    if (bFIXTDM == false)
    {
        if (ui32SampleLenPh1 < ui32SampleLenPh2)
        {
            ui32SampleLenPh2 = ui32SampleLenPh1;
        }

        //
        // -------------------------------------------------------------------------------
        //  Sample length 1    Sample length 2    word width      mask1            mask2
        // -------------------------------------------------------------------------------
        //       32                 32               32           0xFFFFFFFF       0xFFFFFFFF
        //       32                 24               32           0xFFFFFFFF       0xFFFFFF00
        //       32                 16               32           0xFFFFFFFF       0xFFFF0000
        //       32                 8                32           0xFFFFFFFF       0xFF000000
        //       24                 24               32           0x00FFFFFF       0x00FFFFFF
        //       24                 16               32           0x00FFFFFF       0x00FFFF00
        //       24                 8                32           0x00FFFFFF       0x00FF0000
        //       16                 16               16           0xFFFF           0xFFFF
        //       16                 8                16           0xFFFF           0xFF00
        //       8                  8                8            0xFF             0xFF
        // -------------------------------------------------------------------------------
        //
        if (ui32SampleLenPh1 == 32)
        {
            ui32WordBytes = 4;
            ui32Mask1 = 0xFFFFFFFF;
            switch (ui32SampleLenPh2)
            {
                case 32: ui32Mask2 = 0xFFFFFFFF; break;
                case 24: ui32Mask2 = 0xFFFFFF00; break;
                case 16: ui32Mask2 = 0xFFFF0000; break;
                case 8:  ui32Mask2 = 0xFF000000; break;
                default: am_util_stdio_printf("ERROR! Invalidate sample length!"); return false;
            }
        }
        else if (ui32SampleLenPh1 == 24)
        {
            ui32WordBytes = 4;
            ui32Mask1 = 0x00FFFFFF;
            switch (ui32SampleLenPh2)
            {
                case 24: ui32Mask2 = 0x00FFFFFF; break;
                case 16: ui32Mask2 = 0x00FFFF00; break;
                case 8:  ui32Mask2 = 0x00FF0000; break;
                default: am_util_stdio_printf("ERROR! Invalidate sample length!"); return false;
            }
        }
        else if (ui32SampleLenPh1 == 16)
        {
            ui32WordBytes = 2;
            ui32Mask1 = 0xFFFF;
            switch (ui32SampleLenPh2)
            {
                case 16: ui32Mask2 = 0xFFFF; break;
                case 8:  ui32Mask2 = 0xFF00; break;
                default: am_util_stdio_printf("ERROR! Invalidate sample length!"); return false;
            }
        }
        else if (ui32SampleLenPh1 == 8)
        {
            ui32WordBytes = 1;
            ui32Mask1 = 0xFF;
            switch (ui32SampleLenPh2)
            {
                case 8:  ui32Mask2 = 0xFF; break;
                default: am_util_stdio_printf("ERROR! Invalidate sample length!"); return false;
            }
        }
        else
        {
            am_util_stdio_printf("ERROR! Invalidate sample length!");
            return false;
        }
    }
    else
    {
        if (pI2sSetting->phase == AM_HAL_I2S_DATA_PHASE_SINGLE)
        {
            switch (ui32SampleLenPh1)
            {
                case 32: ui32Mask1 = 0xFFFFFFFF; ui32WordBytes = 4; break;
                case 24: ui32Mask1 = 0x00FFFFFF; ui32WordBytes = 4; break;
                case 16: ui32Mask1 = 0xFFFF;     ui32WordBytes = 2; break;
                case 8:  ui32Mask1 = 0xFF;       ui32WordBytes = 1; break;
                default: am_util_stdio_printf("ERROR! Invalidate sample length!"); return false;
            }
        }
        else
        {
            if ((ui32SampleLenPh1 == 16 || ui32SampleLenPh1 == 8) && ((ui32SampleLenPh1 * ui32ChNumPh1 % 32) != 0))
            {
                am_util_stdio_printf("Skipped: bit-depth %d, num of channel %d\n", ui32SampleLenPh1, ui32ChNumPh1);
                return true;
            }

            if ((ui32SampleLenPh2 == 16 || ui32SampleLenPh2 == 8) && ((ui32SampleLenPh2 * ui32ChNumPh2 % 32) != 0))
            {
                am_util_stdio_printf("Skipped: bit-depth %d, num of channel %d\n", ui32SampleLenPh2, ui32ChNumPh2);
                return true;
            }

            ui32WordBytes = 4;
            ui32ChNumPh1 = (ui32SampleLenPh1 == 24) ? (ui32ChNumPh1) : (ui32SampleLenPh1 * ui32ChNumPh1 / 32);
            ui32ChNumPh2 = (ui32SampleLenPh2 == 24) ? (ui32ChNumPh2) : (ui32SampleLenPh2 * ui32ChNumPh2 / 32);
            ui32FrameChNum = ui32ChNumPh1 + ui32ChNumPh2;

            if (ui32SampleLenPh1 == 24)
            {
                ui32Mask1 = 0x00FFFFFF;
            }
            else
            {
                ui32Mask1 = 0xFFFFFFFF;
            }

            if (ui32SampleLenPh2 == 24)
            {
                ui32Mask2 = 0x00FFFFFF;
            }
            else
            {
                ui32Mask2 = 0xFFFFFFFF;
            }
        }
    }

    //
    // Find the beginning sample.
    //
    uint32_t ui32StartPoint = INVALID_START_POINT;
    uint32_t ui32MatchCount = 0;
    uint32_t ui32RxIndex, ui32TxIndex;
    bool bMatchTrue = false;

    //
    // Timing diagram in full-duplex mode.
    // '_' means no data, 'x' means one frame (mono or multi-channel) of data.
    // '[' means the 1st data in RX buffer, ']' means the last data in RX buffer.
    // RX DMA starts one frame before its TX DMA. Refer to the below link for details.
    // https://ambiqmicro.atlassian.net/wiki/spaces/~6285c05356b847006978083d/pages/3475275780/Time+sequence+of+two+I2S+in+the+full-duplex+loopback+test.
    //
    // Normal case: (Diagram 1 and 2 describe the same DMA transfer, the only difference is the RX buffer in the middle line)
    //
    // Diagram 1:
    // Slave data TX:    _______________xxxxxxxxxxxxxxxxxxxxxxxxx________
    // Master data RX:            [_____xxxxxxxxxxxxxxxxxx]         <--- Data are from the above, but the start and end of RX are controlled by the beblow.
    // Master data TX:   __________xxxxxxxxxxxxxxxxxxxxxxxxx_____________
    //
    // Diagram 2:
    // Master data TX:   __________xxxxxxxxxxxxxxxxxxxxxxxxx_____________
    // Slave data RX:                  [xxxxxxxxxxxxxxxxxxxx___]    <--- Data are from the above, but the start and end of RX are controlled by the beblow.
    // Slave data TX:    _______________xxxxxxxxxxxxxxxxxxxxxxxxx________
    //
    // Minimum case: (Diagram 3 and 4 describe the same DMA transfer, the only difference is the RX buffer in the middle line)
    //
    // Diagram 3:
    // Slave data TX:    ___________xxxxxxxxxxxxxxxxxxxxxxxxx____________
    // Master data RX:            [_xxxxxxxxxxxxxxxxxxxxxx]         <--- Two frames of zero in the beginning.
    // Master data TX:   __________xxxxxxxxxxxxxxxxxxxxxxxxx_____________
    //
    // Diagram 4:
    // Master data TX:   __________xxxxxxxxxxxxxxxxxxxxxxxxx_____________
    // Slave data RX:              [xxxxxxxxxxxxxxxxxxxxxxx]        <--- The 1st data in slave RX buffer matches the 1st data from master TX, the end data does the same.
    // Slave data TX:    ___________xxxxxxxxxxxxxxxxxxxxxxxxx____________
    //
    //
    // The maximum allowed lag between master TX and slave TX is 500 us.
    // At 24.576 MHz SCLK, there will be 24.578 MHz * 0.0005 s / 8 bits = 1536 bytes of data which
    // won't be received by the slave RX, or 1536 bytes of zero will be received by the master RX.
    //
    uint32_t ui32StartTolerance = (ui32BufSize > 1536) ? 1536 : ui32BufSize;

    for (i = 0; i < ui32StartTolerance / ui32WordBytes; i++)
    {
        if (bRxIsMaster)
        {
            //
            // The slave transmitter lags behind the master receiver in full-duplex mode, which means there
            // *MUST* be zero data at the beginning of the RX buffer. So we need to find the position in the
            // RX buffer that matches the first sample in the TX buffer.
            //
            ui32RxIndex = i;
            ui32TxIndex = ui32MatchCount;
        }
        else
        {
            //
            // The slave receiver *MAY* lag behind the master transmitter in full-duplex mode, which means there
            // *MAY* be zero data at the end of the RX buffer. So we need to find the position in the TX
            // buffer that matches the first sample in the RX buffer.
            //
            ui32RxIndex = ui32MatchCount;
            ui32TxIndex = i;
        }

        if ((ui32RxIndex % ui32FrameChNum) < ui32ChNumPh1)
        {
            ui32Mask = ui32Mask1;
        }
        else
        {
            ui32Mask = ui32Mask2;
        }

        switch (ui32WordBytes)
        {
            case 1: bMatchTrue = ( ((uint8_t*)pui32RxBuf)[ui32RxIndex] ==   ((uint8_t*)pui32TxBuf)[ui32TxIndex]); break;
            case 2: bMatchTrue = (((uint16_t*)pui32RxBuf)[ui32RxIndex] == (((uint16_t*)pui32TxBuf)[ui32TxIndex] & (uint16_t)ui32Mask)); break;
            case 4: bMatchTrue = (((uint32_t*)pui32RxBuf)[ui32RxIndex] == (((uint32_t*)pui32TxBuf)[ui32TxIndex] & ui32Mask)); break;
        }

        //
        // Until we match 8 bytes of data, we find the start point.
        //
        if (bMatchTrue)
        {
            ui32MatchCount++;
            if ((ui32MatchCount * ui32WordBytes) >= 8)
            {
                ui32StartPoint = i - ui32MatchCount + 1;
                break;
            }
        }
        else
        {
            ui32MatchCount = 0;
        }
    }

    if (ui32StartPoint == INVALID_START_POINT)
    {
        am_util_stdio_printf("Did not find the beginning word in the buffer!\n");
        return false;
    }

    //
    // Compare the remaining data.
    //
    for (i = ui32StartPoint; i < ui32BufSize / ui32WordBytes; i++)
    {
        if(bRxIsMaster)
        {
            ui32RxIndex = i;
            ui32TxIndex = i - ui32StartPoint;
        }
        else
        {
            ui32RxIndex = i - ui32StartPoint;
            ui32TxIndex = i;
        }

        //
        // These two values should be equal, otherwise the transmitter mask is different from the receiver mask.
        //
        if ((ui32RxIndex % ui32FrameChNum) != (ui32TxIndex % ui32FrameChNum))
        {
            am_util_stdio_printf("ERROR: Channel is out of order.\n");
            return false;
        }

        if ((ui32RxIndex % ui32FrameChNum) < ui32ChNumPh1)
        {
            ui32Mask = ui32Mask1;
        }
        else
        {
            ui32Mask = ui32Mask2;
        }

        switch (ui32WordBytes)
        {
            case 1: bMatchTrue = ( ((uint8_t*)pui32RxBuf)[ui32RxIndex] ==   ((uint8_t*)pui32TxBuf)[ui32TxIndex]); break;
            case 2: bMatchTrue = (((uint16_t*)pui32RxBuf)[ui32RxIndex] == (((uint16_t*)pui32TxBuf)[ui32TxIndex] & (uint16_t)ui32Mask)); break;
            case 4: bMatchTrue = (((uint32_t*)pui32RxBuf)[ui32RxIndex] == (((uint32_t*)pui32TxBuf)[ui32TxIndex] & ui32Mask)); break;
        }

        if (bMatchTrue == false)
        {
            am_util_stdio_printf("Data checking faild: Started from: %d, failed at %d, Word bytes %d\n", ui32StartPoint, i, ui32WordBytes);
            return false;
        }
    }

    return true;
}
